import React from 'react';
import './aside.css';

const Aside = () => {
    return (
        <aside>
            <div clas>

                <div className='logo-container'>
                    <img src='images/logo.png' />
                    <h4>Test 3</h4>
                </div>
            </div>
        </aside>
    )
};

export default Aside;
